import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 345,
        background: '#272727',
        color: '#ffffff',
        borderRadius:'12%',
    },
    cardHeader:{
        fontFamily:'Rancho',
    },
    }
))

export default homeStyles
